import React from 'react';
import classes from './Details.module.css';

function Details() {
  return (
    <>
    <div className={classes['right-pane']}>
    <h1>Equinox</h1>
    <h2>No Pain - No Gain!</h2>
    <h1>Details</h1>
    <div col-right>
    <video src={'https://cdn.shopify.com/s/files/1/0397/0079/1341/files/Blanton_s_Bourbon_Home_Page-V1-01_1800x.jpg?v=1618465920'} align="left" />
    <h2>Exercise Name</h2>
    <h2>Exercise Description</h2>
    </div>
    </div>
    </>
  )
}

export default Details
